import React, { Component } from "react";

class GuestList extends Component {
  render() {
    return (
      <div classNmae="GuestList">
        <div className="Guest">
          <table>
            <tr>
              <th>Name</th>
              <th>Number</th>
            </tr>
            <td>Alfred</td>
            <td>066-458-77-88</td>
          </table>
        </div>
      </div>
    );
  }
}

export default GuestList;
